.git/Calculator/Calculator.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
contract Calculator {
    int firstNumber;
    int secondNumber;

    function SetFirstNumber (int256 _FN) public {
        firstNumber = _FN;
    }

    function SetSecondNumber (int256 _SN) public {
        secondNumber = _SN;
    }
     function add() public view returns (int256) {
        return firstNumber + secondNumber;
    }
         function multiplication() public view returns (int256) {
        return firstNumber * secondNumber;
    }
         function division() public view returns (int256) {
        return firstNumber / secondNumber;
    }
         function subtract() public view returns (int256) {
        return firstNumber - secondNumber;
    }
}

